a:260:{i:0;a:1:{s:2:"id";s:19:"2390924189015087404";}i:1;a:1:{s:10:"short_code";s:11:"CEuROHbIhks";}i:2;a:1:{s:12:"created_time";i:1599240395;}i:3;a:1:{s:7:"caption";s:1124:"Chicken Teriyaki mit Konjaknudeln 🥣

Ein Fingerschnipp und der schöne Urlaub 🌊🌞 ist schon wieder vorbei 😔🙈
Ich habe gut und reichlich gegessen und kein bisschen über Kalorien nachgedacht. Es tat wirklich gut. 🤩
Zurück zu Hause geht es jedenfalls jetzt "normal" weiter. ☝️

Heute gab es Chicken Teriyaki.
-300 gr Hähnchenbrustfilet in
-5 gr Kokosöl angebraten 
-150 gr Spitzpaprika 🌶
-200 gr Brokkoli 🥦
-250 gr Champignons 🍄 dazu und 5 Minuten gemeinsam braten.
-1 Portion fertige Teriyaki-Soße und 1 Portion Konjaknudeln unterheben.
Nochmals 5 Minuten köcheln lassen, damit alles schön Geschmack annimmt.
Fertiiiig.... 👩‍🍳
720 Kalorien mit 93 gr EW 

