Co očekáváš: 
Rychlejší a velký váhový úbytek!

Co ve skutečnosti dostaneš?

- Budeš bez energie a věčně unavená. Tenhle pocit tě bude provázet už od samotného rána, kdy otevřeš oči a pomyslíš na to, jak ses dneska zase špatně vyspala. 😔

- Budeš mít neustálé myšlenky na jídlo, budeš toužit po sladkém a víš co? Nakonec Tě to zlomí a tu tabulku čokolády sníš! ☝️

- Můžeš přijít o menstruaci. ❗

- Budeš ve stresu, pravděpodobně se ti zhorší kvalita vlasů, nehtů a pleti! 

- Všechna kila se ti vrátí a přivedou i kámoše jakmile začneš zase jíst nezdravě jako předtím ❗ 

- Budeš mít nekvalitní spánek! 

Co takhle to vzít z jiného konce, pořádně se najíst, dopřát svému tělu všechny potřebné živiny. Protože ano, pořád platí, že ke zdravému a štíhlému tělu se musíš projíst! 😘

Já si taky myslela, že je to blbost, ale zkušenost mi ukázala, že to funguje ♥️

Nehladovte, dopřejte si kvalitní jídlo, budete se cítit fajn ♥️ Pěkný víkend !

